import React, { useState } from "react";
import { Grid, TextField } from "@material-ui/core";

const DCandidateForm = (props) => {
    const {values, setValues} = useState()
    return (
        <form autoComplete="off" noValidate>
            <Grid container>
                <Grid item xs={6}>
                    <TextField 
                    name="fullName"
                    variant="outlined"
                    label="Full Name"
                    />
                </Grid>

            </Grid>

        </form>
    )
}
 
export default DCandidateForm;
